-
  SQL: |
    SELECT 1 from shipping_container_detail sil ignore index(idx3)
    LEFT JOIN shipment_header sr
        ON sr.id=sil.shipmentId 
    LEFT
    JOIN 
        (SELECT DISTINCT itemcode,
            shipmentId ,
            warehouseCode,
            itemListPrice,
            id
        FROM shipment_detail
        WHERE shipmentId in('7545055') ) shl
        ON shl.shipmentId=sil.shipmentId
            AND shl.itemcode=sil.itemcode
            AND shl.id=sil.shipmentDetailId
    LEFT JOIN item_packing_detail i
        ON i.itemCode =sil.itemCode
            AND i.warehouseCode =sil.warehouseCode
            AND i.companyCode =sil.companyCode
    LEFT JOIN item it
        ON it.code = sil.itemCode
            AND it.companyCode =sr.companyCode
            AND it.warehouseCode = sr.warehouseCode
    LEFT JOIN shipping_container_header ignore index(idx1) shr
        ON shr.warehouseCode = sil.warehouseCode
            AND shr.code=sil.containerCode
    INNER JOIN warehouse w
        ON w.code = sr.warehouseCode
    LEFT JOIN ttx_user tr
        ON tr.code=sr.createdBy
    LEFT JOIN 
        (SELECT referenceContId,
            warehouseCode,
            companyCode,
            taskCode
        FROM task_detail td
        WHERE referenceId IN ('7545055')
                AND warehouseCode='SH01'
        GROUP BY  referenceContId ) st
        ON st.warehouseCode =sil.warehouseCode
            AND st.companyCode =sil.companyCode
            AND st.referenceContId =sil.containerId
    WHERE sr.processType <> 'CANCEL'
            AND sr.leadingSts>300
            AND i.unitcode ='CS'
            AND sr.id IN ('7545055')
    GROUP BY  sr.warehouseCode,sr.companyCode ,shr.code,sil.itemCode,sil.batch,shl.itemListPrice
    ORDER BY  shr.Code, sil.itemCode
